import React from "react";
import { Link } from "react-router-dom";
import "./Blog.css";

const Blog = () => {
  const categories = [
    { name: "Nutritional Food", path: "nutritional-food" },
    { name: "Do's and Don'ts", path: "dos-and-donts" },
    { name: "Health and Hygiene", path: "health-and-hygiene" },
    { name: "Play and Learning", path: "play-and-learning" },
    { name: "Parenting Tips", path: "parenting-tips" },
  ];

  return (
    <div className="blog-container">
      <h1>Explore Our Blog</h1>
      <p>Discover helpful articles on parenting, nutrition, health, and more.</p>
      <div className="blog-categories">
        {categories.map((category) => (
          <Link key={category.path} to={`/blog/${category.path}`} className="blog-link">
            {category.name}
          </Link>
        ))}
      </div>
    </div>
  );
};

export default Blog;
